  The GIS files and their associated coordinates are not the legal source for determining
  the critical habitat boundaries of species described in this dataset, but are used
  to identify areas which contain the physical and biological features essential to
  the conservation of the species or areas otherwise determined to be essential. Inherent
  in any dataset used to develop graphical representations, are limitations of accuracy
  as determined, among others, the source, scale and resolution of the data. While
  the U.S. Fish andamp; Wildlife Service makes every effort to represent the critical
  habitat shown with data as completely and accurately as possible (given existing
  time and resource constraints), the USFWS gives no warranty, expressed or implied,
  as to the accuracy, reliability, or completeness of these data. In addition, the
  USFWS shall not be held liable for improper or incorrect use of the data described
  and/or contained herein. Graphical representations provided by the use of these
  data do not represent a legal description of the critical habitat boundary. The
  user is referred to the critical habitat textual description in the appropriate
  final rule for this species as published in the Federal Register. These data are
  to be used only in the context of the definition and purpose of critical habitat.
  This primarily relates to Section 7 consultation under the Endangered Species Act.
  These data may be used for planning and land management purposes. They are not to
  be used for legal survey use. Please refer to Federal Register Citation Number 81FR17790,
  published 20160330 for the legal critical habitat information.\", \"Access Constraints:
